import React from "react"


function PlatformIconList(platform) {
	return (
		<>
		{platform.map(platform => (<p className={styles.platform} key={platform.platform}> {PlatformIconList(platform.platform)} {platform.platform}</p>))}
		</>
	);

}

export default PlatformIconList;
